// ********* cursor swiper code start: from here ************************
let cursor_ball_image_value = localStorage.getItem('cursor_ball_image_value');
console.log(cursor_ball_image_value);
let imageNumber = '1';
if (cursor_ball_image_value == null || cursor_ball_image_value == '3') {
  imageNumber = '1';
  localStorage.setItem('cursor_ball_image_value', 1)
} else if (cursor_ball_image_value == '1') {
  imageNumber = '2';
  localStorage.setItem('cursor_ball_image_value', 2)
} else if (cursor_ball_image_value == '2') {
  imageNumber = '3';
  localStorage.setItem('cursor_ball_image_value', 3)
}
document.querySelector('.ppm_ball').style.backgroundImage = `url('./cursors/cursor${imageNumber}.png')`

// ************** cursor image change ************************************
let ppm_stretch = -(window.innerWidth * .0156);
let ppm_depth = 120
if(window.innerWidth < 600){
  ppm_stretch = -6.5;
  ppm_stretch = -(window.innerWidth * .01915);
  ppm_depth = 100
}
var mySwiper = new Swiper('.swiper-container', {
  loop: true,
  speed: 1000,
  autoplay: {
    delay: 1000,
  },
  effect: 'coverflow',
  grabCursor: true,
  centeredSlides: true,
  slidesPerView: 'auto',
  coverflowEffect: {
    rotate: 0,
    stretch: ppm_stretch,
    depth: ppm_depth,
    modifier: 1,
    slideShadows: false,
  },
})

// Add an event listener for the transition end event

// window.addEventListener('load', animationDesktop)
function animationDesktop() {
  gsap.set('.ppm_model_img',{opacity:0,x:'200%'});
  gsap.set('.ppm_copy_text',{opacity:0,y:'200%'});
  gsap.timeline()
  .to('.ppm_model_img',{opacity:1,x:0,ease:'none',duration:1})
  .to('.ppm_copy_text',{opacity:1,y:0,ease:'none',duration:1,onComplete:()=>{
    gsap.to('.ppm_copy_text',{y:'-4px',repeat:-1,yoyo:true,ease:'none',duration:1})
  }},'<.2')
}
setTimeout(() => {
  animationDesktop()
}, 500);
gsap.set('.ppm_cursor_watches', { x: '-50%' })
gsap.to('.ppm_cursor_watches', { y: '-8%', repeat: -1, duration: 2, yoyo: true, ease: 'none' })
const ball = document.querySelector("div.ppm_ball");
let mouseX = 0;
let mouseY = 0;

let ballX = 0;
let ballY = 0;

let speed = 0.2;

function animate() {
  let distX = mouseX - ballX;
  let distY = mouseY - ballY;


  ballX = ballX + (distX * speed);
  ballY = ballY + (distY * speed);

  ball.style.left = ballX + "px";
  ball.style.top = ballY + "px";

  requestAnimationFrame(animate);
}
animate();
document.addEventListener("mousemove", function (event) {
  mouseX = event.clientX;
  mouseY = event.clientY;
})
document.addEventListener("touchmove", function (event) {
  // console.log(event?.touches[event.touches.length-1])
  let finalTouch = event?.touches[event.touches.length - 1];
  if (!finalTouch) return;
  mouseX = finalTouch.clientX;
  mouseY = finalTouch.clientY;
})

let ppm_clickMacro_url = 'https://shop.shajgoj.com/shop?query=paracute%20advansed%20secrets';
document.querySelector('div.ppm_bottom_static').addEventListener("click", () => { window.open(ppm_clickMacro_url) })
document.querySelector('div.ppm_bottom_staticM').addEventListener("click", () => { window.open(ppm_clickMacro_url) })
document.querySelector('.ppm_bottomM_closeBtn').addEventListener("click", function (e) { hideAll(e) })
document.querySelector('.ppm_bottom_closeBtn').addEventListener("click", function (e) { hideAll(e) })
function hideAll(e){
  e.stopPropagation();
  hideWithoutEvent();
}
let hiddenTheBanner = false;
function hideWithoutEvent(){
  if(hiddenTheBanner) return;
  hiddenTheBanner = true;
  document.querySelector('.ppm_bottom_static').remove()
  document.querySelector('.ppm_bottom_staticM').remove()
  document.querySelector('.ppm_ball').remove() // cursor remove
}

